import React, { Component } from "react";

class SoloStander extends Component {
  state = {};
  render() {
    return <p>here is the SOLO STANDER DATA</p>;
  }
}
class Polly extends Component {
  state = {};
  render() {
    return <p>here is the Polly DATA</p>;
  }
}
class SmartShelves extends Component {
  state = {};
  render() {
    return <p>here is the SmartShelves DATA</p>;
  }
}
class Morph extends Component {
  state = {};
  render() {
    return <p>here is the Morph DATA</p>;
  }
}
class BottleStencil extends Component {
  state = {};
  render() {
    return <p>here is the BottleStencil DATA</p>;
  }
}
class Hydroponics extends Component {
  state = {};
  render() {
    return <p>here is the Hydroponics DATA</p>;
  }
}

export { SoloStander, Polly, SmartShelves, Morph, BottleStencil, Hydroponics };
// export default SoloStander;
